import NavItem from './NavItem';
import { NavLink } from 'react-router-dom';
import About from "../About";
import Homepage from "../Homepage";

const Nav = () => {
    return(
        <>
            <Homepage />
            <NavItem url={`/about`}  linkName={'About'}></NavItem>
            <NavItem url={`/home`} linkName={'Home'}></NavItem>
        </>
    )
}


export default Nav;
